Примечание: Чтобы отключить элемент контекстного меню,
скопируйте это в настройки пользователя и добавьте параметр
«disabled». Следующий пример отключит загрузку файлов для файлов:
{
  "contextMenu": [
    {
      "command": "filebrowser:download",
      "selector": ".jp-DirListing-item[data-isdir=\"false\"]",
      "disabled": true
    }
  ]
}

