Примечание. Чтобы отключить меню или пункт меню, скопируйте его в пользовательские настройки и добавьте ключ "disabled". Следующий пример отключит меню «Вкладки» и «Перезапустить ядро ​​и перейти к выбранной ячейке»:
  "menus": [
    {
      "id": "jp-mainmenu-tabs",
      "disabled": true
    },
    {
      "id": "jp-mainmenu-kernel",
      "items": [
        {
          "command": "notebook:restart-and-run-to-selected",
          "disabled": true
        }
      ]
    }
  ]
}

